var pet = this.getObjectByName("Pet");

function movement(x,y,z){

	pet.position.y += y;
	pet.position.x += x;
	pet.position.z += z;

}

function keydown(event){
	if(event.which == 37){
		movement(1,1,0);
	}
	if(event.which == 38){
		movement(0,1,1);
	}
	if(event.which == 39){
		movement(-1,1,0);
	}
	if(event.which == 40){
		movement(0,1,-1);
	}
}

function keyup(event){
	if(event.which == 37){
		movement(1,-1,0);
	}
	if(event.which == 38){
		movement(0,-1,1);
	}
	if(event.which == 39){
		movement(-1,-1,0);
	}
	if(event.which == 40){
		movement(0,-1,-1);
	}
}
var count = 0;
function update( event ) {



	var time = event.time * 0.00025;

	if(count == 20){
		pet.position.y += 1;
		pet.position.z = Math.sin( time * 1.3) * 4;
		pet.position.x = Math.cos( time * 1.3 ) * 4;
	}
	if(count == 40){
		pet.position.y -= 1;
		pet.position.z = Math.sin( time * 1.3) * 4;
		pet.position.x = Math.cos( time * 1.3 ) * 4;
		count = 0;
	}



	count++;

}
